import Carousel from "../../components/Carousel/Carousel";
import Layout from "../../components/Layout/Layout";
import Ressource from "../../components/Ressource/Ressource";
import TableFournisseur from "../../components/TableFournisseur/TableFournisseur";

function dashbord (){
    return(
    <div className="flex flex-col justify-center m-20">
        <Layout>
            <div className="flex flex-col justify-center items-center text-xl gap-5 my-20">
                <li><a href="fournisseur">fournisseur</a></li>
                <li><a href="ressource">ressource</a></li>
                <li><a href="materiaux">materiaux</a></li>
            </div>
        </Layout>
        <div className="flex flex-row justify-center gap-40 m-10">
            <Carousel />
            <TableFournisseur />
        </div>
        <Ressource />
    </div>
)}
export default dashbord;
